css:
.editor .marker .region {
  position: absolute;
  pointer-events: none;
  z-index: -1;
}
.pane.active .editor .highlight-selected .marker .region {
  border-radius: 2px;
  box-sizing: content-box;
  padding: 0 0px;
  margin: -1px 0 0 0;
  background-color: transparent;
  border: 1px solid #dddddd;
}
